import React, { useState } from 'react';
import { MOCK_BATCH_RESULTS, MOCK_BATCH_SUMMARY } from '../data/mockData';
import DemoHeader from './DemoHeader';

const BatchProcessing = () => {
  const [files, setFiles] = useState([]);
  const [results, setResults] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [summary, setSummary] = useState(null);

  const demoFiles = [
    { name: 'senior_security_architect_job.pdf', size: 187392 },
    { name: 'penetration_tester_position.pdf', size: 156672 },
    { name: 'soc_analyst_opening.pdf', size: 143360 },
    { name: 'infosec_manager_role.pdf', size: 198144 },
    { name: 'cybersecurity_consultant_job.pdf', size: 175104 },
    { name: 'security_engineer_posting.pdf', size: 164896 }
  ];

  const handleFileUpload = (event) => {
    const uploadedFiles = Array.from(event.target.files);
    setFiles(uploadedFiles);
  };

  const loadDemoFiles = () => {
    const mockFiles = demoFiles.map(fileInfo => ({
      name: fileInfo.name,
      size: fileInfo.size,
      type: 'application/pdf'
    }));
    setFiles(mockFiles);
  };

  const processFiles = () => {
    if (files.length === 0) {
      alert('Please select job posting files to process or load demo files');
      return;
    }

    setIsProcessing(true);
    setTimeout(() => {
      setResults(MOCK_BATCH_RESULTS);
      setSummary(MOCK_BATCH_SUMMARY);
      setIsProcessing(false);
    }, 3000);
  };

  const clearFiles = () => {
    setFiles([]);
    setResults(null);
    setSummary(null);
  };

  const downloadResults = () => {
    if (!results) return;

    const dataStr = JSON.stringify(results, null, 2);
    const dataBlob = new Blob([dataStr], { type: 'application/json' });
    const url = URL.createObjectURL(dataBlob);
    const link = document.createElement('a');
    link.href = url;
    link.download = 'batch_analysis_results.json';
    link.click();
  };

  return (
    <section className="services">
      <div className="container">
        <div className="section-title">
          <h2>Batch Processing</h2>
          <p>Upload multiple job postings to extract and summarize skills</p>
        </div>

        <div className="card p-4 mb-4">
          <div className="form-group">
            <label>Upload Job Postings for Skill Extraction</label>
            <input
              type="file"
              multiple
              accept=".pdf,.doc,.docx,.txt"
              onChange={handleFileUpload}
              className="form-control"
            />
          </div>

          <p className="mt-3">Try our demo files to see the system in action:</p>
          <button onClick={loadDemoFiles} className="btn btn-secondary btn-sm mb-3">
            Load Demo Job Postings ({demoFiles.length} sample positions)
          </button>

          {files.length > 0 && (
            <div>
              <h5>Selected Files ({files.length})</h5>
              <ul>
                {files.map((file, index) => (
                  <li key={index}>
                    {file.name} ({(file.size / 1024).toFixed(1)} KB)
                  </li>
                ))}
              </ul>
            </div>
          )}

          <div className="d-flex gap-2 mt-3">
            <button
              onClick={processFiles}
              disabled={isProcessing || files.length === 0}
              className="btn btn-success"
            >
              {isProcessing ? 'Extracting...' : 'Extract Skills from Job Postings'}
            </button>
            <button onClick={clearFiles} className="btn btn-outline-danger">
              Clear All
            </button>
          </div>
        </div>

        {isProcessing && (
          <div className="alert alert-info text-center">
            <strong>Processing:</strong> Extracting skills from {files.length} job postings...
          </div>
        )}

        {summary && (
          <div className="card p-4 mb-4">
            <h4>Extraction Summary</h4>
            <div className="row text-center">
              <div className="col"><strong>{summary.total_jobs}</strong><div>Job Postings</div></div>
              <div className="col"><strong>{summary.categories_found}</strong><div>Categories Found</div></div>
              <div className="col"><strong>{summary.model_mode}</strong><div>Model Mode</div></div>
              <div className="col"><strong>{summary.extractor_mode}</strong><div>Extractor Mode</div></div>
            </div>
          </div>
        )}

        {results && (
          <div className="card p-4">
            <div className="d-flex justify-content-between align-items-center mb-3">
              <h4 className="mb-0">Skill Extraction Results</h4>
              <button onClick={downloadResults} className="btn btn-outline-primary btn-sm">
                Download Results
              </button>
            </div>

            <div className="row">
              {results.map((result, index) => (
                <div key={index} className="col-md-6 mb-4">
                  <div className="border rounded p-3 h-100">
                    <h5>{result.job_title}</h5>
                    <span className="badge bg-primary">{result.prediction.category_name}</span>
                    <p className="text-muted small mt-2">{result.prediction.category_description}</p>
                    <h6>Skills Found ({result.skills.skill_count})</h6>
                    <div>
                      {result.skills.extracted_skills.slice(0, 3).map((skill, i) => (
                        <span key={i} className="badge bg-light text-dark border me-1 mb-1">{skill.name}</span>
                      ))}
                      {result.skills.skill_count > 3 && (
                        <span className="badge bg-secondary">+{result.skills.skill_count - 3} more</span>
                      )}
                    </div>
                    <div className="mt-2">
                      {result.skills.extracted_skills.map((skill, i) => (
                        <div key={i} className="mb-2">
                          <strong>{skill.name}</strong>
                          <p className="mb-0 small text-muted">{skill.description}</p>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default BatchProcessing;
